def min_coins(amount):
    """"""
    coins = [float('inf')] * (amount + 1)
    coins[0] = 0
    for coin in [1, 5, 10]:
        for i in range(coin, amount + 1):
            coins[i] = min(coins[i], coins[i - coin] + 1)
    return coins[amount] if coins[amount] != float('inf') else -1
